import axios from 'axios';

const USER_API_BASE_URL = "http://localhost:8080/todolist/api/v1/user";

class UserService {

    createTask(task){
        return axios.post(USER_API_BASE_URL + '/add-list',task);
    }
    getAllTasks(){
        return axios.get(USER_API_BASE_URL + '/list/all');
    }

    getTaskByTaskName(taskName){
        return axios.get(USER_API_BASE_URL + '/list/{taskName}' + taskName);
    }
    getUserById(id){
        return axios.get(USER_API_BASE_URL+'/listAll/:id',id)
    }
    updateTask(id, updateTask){
        return axios.put(USER_API_BASE_URL + '/update/{id}' + id, updateTask);
    }

}

export default new UserService();
